Lexi Belle Loves Girls (Dana Vespoli, Sweetheart Video / 2014)

Sweetheart proudly presents its latest release in this heavily lauded series: superstar Lexi Belle. Lexi reveals herself as she never has before, through behind the scenes coverage, personal interviews, and interviews with four of her favorite girls: Skin Diamond, Raven Rockette, Kristina Rose and Nikki Hearts. Lexi lives out four different fantasies with each girl, showing us how playful, passionate, intense and beautiful she and her girlfriends are!

Kristina Rose, Lexi Belle, Raven Rockette, Skin Diamond

All Girl / Lesbian, All Sex

